import { Link, Route, Switch } from "react-router-dom";
const Navigation = () => {
  return (
    <>
      <h4>Navigation</h4>
      <div>
        <nav style={{ width: "100%" }}>
          <Link to="/">Home</Link>
          <Link to="/contact">Contact</Link>
          <Link to="about">About</Link>
        </nav>
        <fieldset style={{ width: "100%" }}>
          <legend>Page</legend>
        </fieldset>
      </div>
    </>
  );
};

export default Navigation;
